import React from 'react';
import "./graph/graph.css"

export function Graph({ roiRates }) {
  const years = Object.values(roiRates)
  const dataRates = years.map((x) => {
    const initialRate = years[0]
    return x/initialRate
  })
  console.log(dataRates)
  return (
    <div>
        {dataRates.map((rate) => {
            return (
                <div className="column" style={{height: 50*rate}}></div>
            )
        })}
    </div>
  )
}
